true" aria-label="Previous page"><svg xmlns="http://www.w3.org/2000/svg" fill="none" height="14" width="14" viewBox="0 0 24 24" class="sc-16r8icm-0 dWGZqy"><path d="M15 6L9 12L15 18" stroke="currentColor" stroke-width="2" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"></path></svg></a></li><li class="page active"><a role="button" tabindex="0" aria-label="Page 1 is your current page" aria-current="page">1</a></li><li class="page"><a role="button" href="/?page=2" tabindex="0" aria-label="Page 2">2</a></li><li class="page"><a role="button" href="/?page=3" tabindex="0" aria-label="Page 3">3</a></li><li class="page"><a role="button" href="/?page=4" tabindex="0" aria-label="Page 4">4</a></li><li class="page"><a role="button" href="/?page=5" tabindex="0" aria-label="Page 5">5</a></li><li class="page"><a role="button" href="/?page=6" tabindex="0" aria-label="Page 6">6</a></li><li class="break"><a role="button" tabindex="0">...</a></li><li class="page"><a role="button" href="/?page=101" tabindex="0" aria-label="Page 101">101</a></li><li class="next"><a class="chevron" href="/?page=2" tabindex="0" role="button" aria-disabled="false" aria-label="Next page"><svg xmlns="http://www.w3.org/2000/svg" fill="none" height="14" width="14" viewBox="0 0 24 24" class="sc-16r8icm-0 dWGZqy"><path d="M9 6L15 12L9 18" stroke="currentColor" stroke-width="2" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"></path></svg></a></li></ul></div></div><div class="sc-16r8icm-0 sc-4r7b5t-1 entgiO"><p color="text2" font-size="1" class="sc-1eb5slv-0 htiVYl">Show rows</p><div class="sc-16r8icm-0 tu1guj-0 cSTqvK">100<svg xmlns="http://www.w3.org/2000/svg" fill="none" height="14" width="14" viewBox="0 0 24 24" class="sc-16r8icm-0 dWGZqy"><path d="M6 9L12 15L18 9" stroke="currentColor" stroke-width="2" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"></path></svg></div></div></div><div class="g6yppo-0 hwSoTL"><div class="seo-text__title"><div>Find out how we work by clicking here. </div><span id="drop-anchor">Read More</span></div><div class="seo-text__content" style="display:none"><div class="seo-text-translations"><h2>Today’s Cryptocurrency Prices, Charts and Data</h2> <p> Welcome to CoinMarketCap.com! This site was founded in May 2013 by Brandon Chez to provide up-to-date cryptocurrency prices, charts and data about the emerging cryptocurrency markets. Since then, the world of blockchain and cryptocurrency has grown exponentially and we are very proud to have grown with it. We take our data very seriously and we do not change our data to fit any narrative: we stand for accurately, timely and unbiased information. </p> <h2>All Your Crypto Market Data Needs in One Place</h2> <p> Here at CoinMarketCap, we work very hard to ensure that all the relevant and up-to-date information about cryptocurrencies, coins and tokens can be located in one easily discoverable place. From the very first day, the goal was for the site to be the number one location online for crypto market data, and we work hard to empower our users with our unbiased and accurate information. </p> <h3>We Provide Live and Historic Crypto Charts for Free</h3> <p> Each of our coin data pages has a graph that shows both the current and historic price information for the coin or token. Normally, the graph starts at the launch of the asset, but it is possible to select specific to and from dates to customize the chart to your own needs. These charts and their information are free to visitors of our website. </p> <h3>How Do We Calculate Our Cryptocurrency Prices?</h3> <p> We receive updated cryptocurrency prices directly from many exchanges based on their pairs. We then convert the number to USD. A full explanation can be found <a target=‘_blanket’ href='https://support.coinmarketcap.com/hc/en-us/articles/360043395752-Price-Market-Pair-Cryptoasset-'  > here</a>. </p> <p> Related Links <br /> New to crypto? <a href='https://coinmarketcap.com/how-to-buy-bitcoin/' target=‘_blanket’> Learn how to buy bitcoin today</a>. <br /> Ready to learn more? Visit our <a href='https://coinmarketcap.com/alexandria/glossary' target=‘_blank’> crypto glossary </a> and <a href='https://coinmarketcap.com/alexandria/' target='_blank'>Learning hub</a>. <br /> Want to look up a transaction? <a target='_blank' href='https://blockchain.coinmarketcap.com/'  > Visit our blockchain explorer.</a> </p> <h3> How Do We Calculate Our Crypto Valuations?</h3> <p> We calculate our valuations based on the total circulating supply of an asset multiplied by the currency reference price. The topic is explained in more detail <a target='_blank' href='https://support.coinmarketcap.com/hc/en-us/articles/360043836811-Market-Capitalization-Cryptoasset-Aggregate-'  > here</a>. </p> <h3>How Do We Calculate the Cryptocurrency Market Cap?</h3> <p> We calculate the total cryptocurrency market capitalization as the sum of all cryptocurrencies listed on the site. </p> <h2>Does CoinMarketCap.com List All Cryptocurrencies?</h2> <p> No, we do not list all cryptocurrencies at CoinMarketCap. As a company and team, we are very aware that not all coins and projects have good intentions. While we cannot guarantee to exclude them all, we have a vetting process that each coin goes through before it is listed on the site. If we suspect that a coin or project is a scam, it does not get listed. </p> <h3>How Big Is the Global Coin Market?</h3> <p> At the time of writing, we estimate that there are around 8,000 coins, tokens and projects in the global coin market. As mentioned above, we have a <a href='https://support.coinmarketcap.com/hc/en-us/articles/360043659351-Listings-Criteria' target='_blank' >due diligence process</a> that we apply to new coins before they are listed. This process controls how many of the cryptocurrencies from the global market are represented on our site. </p> <h3> What Is an Altcoin?</h3> <p> The very first cryptocurrency was <a href='https://coinmarketcap.com/currencies/bitcoin/' target='_blank'> Bitcoin</a>. Since it is open source, it is possible for other people to use the majority of the code, make a few changes and then launch their own separate currency. Many people have done exactly this. Some of these coins are very similar to Bitcoin, with just one or two amended features (such as <a href='https://coinmarketcap.com/currencies/litecoin/' target='_blank'>Litecoin</a>), while others are very different, with varying models of security, issuance and governance. However, they all share the same moniker — every coin issued after Bitcoin is considered to be an altcoin. </p> <h3> What Is an ICO?</h3> <p> ICO stands for initial coin offering. Many of the smaller projects in the crypto space — and a few of the largest ones — raised money from private investors around the world in the crypto equivalent of a crowdfunding campaign. Investors would send funds — usually in the form of Bitcoin — to the project and receive coin or tokens in return.<br /> Most ICOs happened in 2017 and early 2018 and used <a href='https://coinmarketcap.com/currencies/ethereum/' target='_blank'>Ethereum</a> as a platform of operation via the ERC-20 standard. In 2018, the United States Securities and Exchange Commission (SEC) clarified their rules relating to fundraising for assets, which made it much harder for new cryptocurrency projects to issue their own tokens in this way. Since the appearance of the SEC guidance and the organization’s heightened interest in regulating ICOs for U.S. citizens, the number of ICOs has been reduced substantially. </p> <h3> What Is a Stablecoin?</h3> <p> Price volatility has long been one of the features of the cryptocurrency market. When asset prices move quickly in either direction and the market itself is relatively thin, it can sometimes be difficult to conduct transactions as might be needed. To overcome this problem, a new type of cryptocurrency tied in value to existing currencies — ranging from the U.S. dollar, other fiats or even other cryptocurrencies — arose. These new cryptocurrency are known as stablecoins, and they can be used for a multitude of purposes due to their stability. </p> <h3 id="what-are-in-game-tokens-">What Are In-game Tokens?</h3> <p><a href="https://coinmarketcap.com/alexandria/glossary/play2earn-play-to-earn">Play-to-earn</a> (P2E) games, also known as <a href="https://coinmarketcap.com/alexandria/glossary/gamefi">GameFi</a>, has emerged as an extremely popular category in the crypto space. It combines <a href="https://coinmarketcap.com/alexandria/glossary/non-fungible-token">non-fungible tokens</a> (NFT), in-game crypto tokens, <a href="https://coinmarketcap.com/alexandria/glossary/defi">decentralized finance</a> (DeFi) elements and sometimes even metaverse applications. Players have an opportunity to generate revenue by giving their time (and sometimes capital) and playing these games.</p> <p>One of the biggest winners is <a href="https://coinmarketcap.com/currencies/axie-infinity/">Axie Infinity</a> — a Pokémon-inspired game where players collect Axies (NFTs of digital pets), breed and battle them against other players to earn Smooth Love Potion (SLP) — the in-game reward token. This game was extremely popular in developing countries like The Philippines, due to the decent income they can earn. Players in the Philippines can check the price of <a href="https://coinmarketcap.com/currencies/smooth-love-potion/slp/php/">SLP to PHP today</a> directly on CoinMarketCap.</p> <h2>Which Is the Best Cryptocurrency to Invest in? </h2> <p> CoinMarketCap does not offer financial or investment advice about which cryptocurrency, token or asset does or does not make a good investment, nor do we offer advice about the timing of purchases or sales. We are strictly a data company. <br /> Please remember that the prices, yields and values of financial assets change. This means that any capital you may invest is at risk. We recommend seeking the advice of a professional investment advisor for guidance related to your personal circumstances. </p> <h3>If You Are Investing in Cryptocurrency — CoinMarketCap.com Is for You</h3> <p> The data at CoinMarketCap updates throughout the day, which means that it is possible to check in on the value of your investments and assets at any time and from anywhere in the world. We look forward to seeing you regularly! </p></div><span></span></div></div></div><div class="lpzyzc-0 lpzyzc-2 iWxLAf"><svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" height="24px" width="24px" viewBox="0 0 24 24" class="sc-1prm8qw-0 eFjnQR close-button"><path d="M18 6L6 18M18 18L6 6" stroke="currentColor" stroke-width="2" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"></path><svg></svg></svg><div class="cmc-earn-intro-popup__contents"><div><em class="markout-title">Time to Ship — CMC&#x27;s online conference recap is right here!</em></div><div class="buttons"><button target="_blank" class="sc-1ebmiy2-0 jJXodk w3d6ha-0 klRKLd cmc-button">View</button><button class="sc-1ebmiy2-0 dCqZTO cmc-button-plain"><b>No, thanks</b></button></div></div><div class="cmc-earn-intro-popup__image"></div></div><div class="lpzyzc-0 lpzyzc-1 kXmtVc"><img src="https://s2.coinmarketcap.com/static/cloud/img/events/event-2022-collapsed.png"/></div></div></div></div><div style="height:300px"></div><section data-hydration-on-demand="true"><footer class="sc-1oj4kco-0 blkuuM"><div class="sc-1oj4kco-1 ciYBLV"><div class="sc-1oj4kco-2 geDbaW"><div class="sc-73pwfm-0 dxFBdl cmc-logo"></div></div><div class="sc-1oj4kco-3 jYQQwj"><div class="footer-row"><div class="sc-1oj4kco-6 lijEzx"><span>Products</span><ul><li><a target="_blank" href="https://blockchain.coinmarketcap.com/?utm_source=coinmarketcap&amp;utm_content=footer" rel="noopener">Blockchain Explorer</a></li><li><a target="_blank" href="https://coinmarketcap.com/api/" rel="noopener">Crypto API</a></li><li><a target="_blank" href="https://coinmarketc