55c4c346203827ab52d8fe","adsPosition":0}],"4":[{"id":"60f659d1c32e840d40347d59","adsPosition":1},{"id":"615e5ba76c267b5fa2818b36","adsPosition":0},{"id":"6263002eaeb37e4d60409c9b","adsPosition":0}]},"SearchSponsored":["60f659d1c32e840d40347d5a","60f659d1c32e840d40347d5b","612fe57d089234523b724ca7","612fe5b611054f05ca68b1b4","615c71aedf947b77423f3f60","615c71dcdf947b77423f3f61","61a67d8ea2da307aeb46bc85","61a67db0a2da307aeb46bc86","61e9b2b8ae21612e270fbd70","61e9b2dba3ebca515e47e955"],"TrendingSponsored":["60fa02e93ba9832048c7e91f","61a67df281157a18065880ea","626ae62f7d1c136ae3841ad5"]}}}},"initialProps":{"initialI18nStore":{"en":{"common":{"Open App":"Open"},"homepage":{"homepage_seo_text":"\u003ch2\u003eToday’s Cryptocurrency Prices, Charts and Data\u003c/h2\u003e \u003cp\u003e Welcome to CoinMarketCap.com! This site was founded in May 2013 by Brandon Chez to provide up-to-date cryptocurrency prices, charts and data about the emerging cryptocurrency markets. Since then, the world of blockchain and cryptocurrency has grown exponentially and we are very proud to have grown with it. We take our data very seriously and we do not change our data to fit any narrative: we stand for accurately, timely and unbiased information. \u003c/p\u003e \u003ch2\u003eAll Your Crypto Market Data Needs in One Place\u003c/h2\u003e \u003cp\u003e Here at CoinMarketCap, we work very hard to ensure that all the relevant and up-to-date information about cryptocurrencies, coins and tokens can be located in one easily discoverable place. From the very first day, the goal was for the site to be the number one location online for crypto market data, and we work hard to empower our users with our unbiased and accurate information. \u003c/p\u003e \u003ch3\u003eWe Provide Live and Historic Crypto Charts for Free\u003c/h3\u003e \u003cp\u003e Each of our coin data pages has a graph that shows both the current and historic price information for the coin or token. Normally, the graph starts at the launch of the asset, but it is possible to select specific to and from dates to customize the chart to your own needs. These charts and their information are free to visitors of our website. \u003c/p\u003e \u003ch3\u003eHow Do We Calculate Our Cryptocurrency Prices?\u003c/h3\u003e \u003cp\u003e We receive updated cryptocurrency prices directly from many exchanges based on their pairs. We then convert the number to USD. A full explanation can be found \u003ca target=‘_blanket’ href='https://support.coinmarketcap.com/hc/en-us/articles/360043395752-Price-Market-Pair-Cryptoasset-'  \u003e here\u003c/a\u003e. \u003c/p\u003e \u003cp\u003e Related Links \u003cbr /\u003e New to crypto? \u003ca href='https://coinmarketcap.com/how-to-buy-bitcoin/' target=‘_blanket’\u003e Learn how to buy bitcoin today\u003c/a\u003e. \u003cbr /\u003e Ready to learn more? Visit our \u003ca href='https://coinmarketcap.com/alexandria/glossary' target=‘_blank’\u003e crypto glossary \u003c/a\u003e and \u003ca href='https://coinmarketcap.com/alexandria/' target='_blank'\u003eLearning hub\u003c/a\u003e. \u003cbr /\u003e Want to look up a transaction? \u003ca target='_blank' href='https://blockchain.coinmarketcap.com/'  \u003e Visit our blockchain explorer.\u003c/a\u003e \u003c/p\u003e \u003ch3\u003e How Do We Calculate Our Crypto Valuations?\u003c/h3\u003e \u003cp\u003e We calculate our valuations based on the total circulating supply of an asset multiplied by the currency reference price. The topic is explained in more detail \u003ca target='_blank' href='https://support.coinmarketcap.com/hc/en-us/articles/360043836811-Market-Capitalization-Cryptoasset-Aggregate-'  \u003e here\u003c/a\u003e. \u003c/p\u003e \u003ch3\u003eHow Do We Calculate the Cryptocurrency Market Cap?\u003c/h3\u003e \u003cp\u003e We calculate the total cryptocurrency market capitalization as the sum of all cryptocurrencies listed on the site. \u003c/p\u003e \u003ch2\u003eDoes CoinMarketCap.com List All Cryptocurrencies?\u003c/h2\u003e \u003cp\u003e No, we do not list all cryptocurrencies at CoinMarketCap. As a company and team, we are very aware that not all coins and projects have good intentions. While we cannot guarantee to exclude them all, we have a vetting process that each coin goes through before it is listed on the site. If we suspect that a coin or project is a scam, it does not get listed. \u003c/p\u003e \u003ch3\u003eHow Big Is the Global Coin Market?\u003c/h3\u003e \u003cp\u003e At the time of writing, we estimate that there are around 8,000 coins, tokens and projects in the global coin market. As mentioned above, we have a \u003ca href='https://support.coinmarketcap.com/hc/en-us/articles/360043659351-Listings-Criteria' target='_blank' \u003edue diligence process\u003c/a\u003e that we apply to new coins before they are listed. This process controls how many of the cryptocurrencies from the global market are represented on our site. \u003c/p\u003e \u003ch3\u003e What Is an Altcoin?\u003c/h3\u003e \u003cp\u003e The very first cryptocurrency was \u003ca href='https://coinmarketcap.com/currencies/bitcoin/' target='_blank'\u003e Bitcoin\u003c/a\u003e. Since it is open source, it is possible for other people to use the majority of the code, make a few changes and then launch their own separate currency. Many people have done exactly this. Some of these coins are very similar to Bitcoin, with just one or two amended features (such as \u003ca href='https://coinmarketcap.com/currencies/litecoin/' target='_blank'\u003eLitecoin\u003c/a\u003e), while others are very different, with varying models of security, issuance and governance. However, they all share the same moniker — every coin issued after Bitcoin is considered to be an altcoin. \u003c/p\u003e \u003ch3\u003e What Is an ICO?\u003c/h3\u003e \u003cp\u003e ICO stands for initial coin offering. Many of the smaller projects in the crypto space — and a few of the largest ones — raised money from private investors around the world in the crypto equivalent of a crowdfunding campaign. Investors would send funds — usually in the form of Bitcoin — to the project and receive coin or tokens in return.\u003cbr /\u003e Most ICOs happened in 2017 and early 2018 and used \u003ca href='https://coinmarketcap.com/currencies/ethereum/' target='_blank'\u003eEthereum\u003c/a\u003e as a platform of operation via the ERC-20 standard. In 2018, the United States Securities and Exchange Commission (SEC) clarified their rules relating to fundraising for assets, which made it much harder for new cryptocurrency projects to issue their own tokens in this way. Since the appearance of the SEC guidance and the organization’s heightened interest in regulating ICOs for U.S. citizens, the number of ICOs has been reduced substantially. \u003c/p\u003e \u003ch3\u003e What Is a Stablecoin?\u003c/h3\u003e \u003cp\u003e Price volatility has long been one of the features of the cryptocurrency market. When asset prices move quickly in either direction and the market itself is relatively thin, it can sometimes be difficult to conduct transactions as might be needed. To overcome this problem, a new type of cryptocurrency tied in value to existing currencies — ranging from the U.S. dollar, other fiats or even other cryptocurrencies — arose. These new cryptocurrency are known as stablecoins, and they can be used for a multitude of purposes due to their stability. \u003c/p\u003e \u003ch3 id=\"what-are-in-game-tokens-\"\u003eWhat Are In-game Tokens?\u003c/h3\u003e \u003cp\u003e\u003ca href=\"https://coinmarketcap.com/alexandria/glossary/play2earn-play-to-earn\"\u003ePlay-to-earn\u003c/a\u003e (P2E) games, also known as \u003ca href=\"https://coinmarketcap.com/alexandria/glossary/gamefi\"\u003eGameFi\u003c/a\u003e, has emerged as an extremely popular category in the crypto space. It combines \u003ca href=\"https://coinmarketcap.com/alexandria/glossary/non-fungible-token\"\u003enon-fungible tokens\u003c/a\u003e (NFT), in-game crypto tokens, \u003ca href=\"https://coinmarketcap.com/alexandria/glossary/defi\"\u003edecentralized finance\u003c/a\u003e (DeFi) elements and sometimes even metaverse applications. Players have an opportunity to generate revenue by giving their time (and sometimes capital) and playing these games.\u003c/p\u003e \u003cp\u003eOne of the biggest winners is \u003ca href=\"https://coinmarketcap.com/currencies/axie-infinity/\"\u003eAxie Infinity\u003c/a\u003e — a Pokémon-inspired game where players collect Axies (NFTs of digital pets), breed and battle them against other players to earn Smooth Love Potion (SLP) — the in-game reward token. This game was extremely popular in developing countries like The Philippines, due to the decent income they can earn. Players in the Philippines can check the price of \u003ca href=\"https://coinmarketcap.com/currencies/smooth-love-potion/slp/php/\"\u003eSLP to PHP today\u003c/a\u003e directly on CoinMarketCap.\u003c/p\u003e \u003ch2\u003eWhich Is the Best Cryptocurrency to Invest in? \u003c/h2\u003e \u003cp\u003e CoinMarketCap does not offer financial or investment advice about which cryptocurrency, token or asset does or does not make a good investment, nor do we offer advice about the timing of purchases or sales. We are strictly a data company. \u003cbr /\u003e Please remember that the prices, yields and values of financial assets change. This means that any capital you may invest is at risk. We recommend seeking the advice of a professional investment advisor for guidance related to your personal circumstances. \u003c/p\u003e \u003ch3\u003eIf You Are Investing in Cryptocurrency — CoinMarketCap.com Is for You\u003c/h3\u003e \u003cp\u003e The data at CoinMarketCap updates throughout the day, which means that it is possible to check in on the value of your investments and assets at any time and from anywhere in the world. We look forward to seeing you regularly! \u003c/p\u003e"}}},"initialLanguage":"en","i18nServerInstance":null,"pageProps":{"cryptocurrency